import React from 'react';
import store from './redux/store'
import {Provider} from 'react-redux'
import moduleName from 'react-router'

const Main = () => {
    return (
        <div>
            <Provider store = {store}>
            <Hashrouter>
                <nav>
                    <ul>
                        <li></li>
                    </ul>
                </nav>
            </Hashrouter>
            </Provider>
        </div>
    )
}


export default Main;
